window.bookSummaryJSON = "<p><b>Chaos awakens alone, surrounded by an endless jungle. </b></p> <p>When she discovers a small village of natives, the world-weary reincarnator finds peace of mind for the first time in forever. Lulled by the tranquil atmosphere, she forgets her worries. But when outsiders arrive, they bring war onto the doorsteps of her new home. Once more, the Crawling Chaos gathers her will to fight.</p> <p>In a land where gods walk among the people, Chaos discovers herself anew. Finding pieces of her past and making new friends along the way, the reincarnated high school girl goes on a journey that shall go down in the annals of history. When the pieces fall into place, she will learn a truth about the world she would have rather not known.</p> <p>Our lovable Cosmic Horror is brought to new lands with unfamiliar sights and wondrous discoveries. But even if it looks like a fresh start, she can't shake her nature and extends a helping hand to those in need.</p> <p><b>The Demon Princess Magical Chaos series contains gore and explicit sexual content. It's intended for mature listeners.</b></p>"; 
